using namespace std;

namespace // anonymous
{
    int get_number_of_ordinates_per_octant(int rule)
    {
        Assert(rule > 0 && rule < 7);
        vector<int> const rules = {4, 16, 64, 256, 1024, 4096};
        return rules[rule - 1];
    }
    int get_number_of_ordinates(int dimension,
                                int rule)
    {
        Assert(dimension == 2 || dimension == 3);
        int number_of_ordinates_per_octant = get_number_of_ordinates_per_octant(rule);

        return number_of_ordinates_per_octant * 4 * (dimension - 1);
    }
}


LDFE_Quadrature::
LDFE_Quadrature(int dimension,
                int number_of_scattering_moments,
                int rule):
    Angular_Discretization(dimension,
                           number_of_scattering_moments,
                           get_number_of_ordinates(dimension,
                                                   rule)),
    rule_(rule)
{
    reflection_tolerance_ = 1000 * numeric_limits<double>::epsilon();
    initialize_quadrature();

    directions_.resize(number_of_ordinates_);
    for (int o = 0; o < number_of_ordinates_; ++o)
    {
        vector<double> direction(dimension_);
        
        for (int d = 0; d < dimension_; ++d)
        {
            direction[d] = ordinates_[d + dimension * o];
        }

        directions_[o] = direction;
    }
    
    check_class_invariants();
}

void LDFE_Quadrature::
initialize_quadrature()
{
    // Get data table
    int data_length = 4;
    int number_of_ordinates_per_octant = get_number_of_ordinates_per_octant(rule_);
    vector<double> data;
    get_octant_values(rule_,
                      data);
    Assert(data.size() == number_of_ordinates_per_octant * data_length);
    
    // Multiply weights by 4\pi to normalize appropriately
    for (int i = 0; i < number_of_ordinates_per_octant; ++i)
    {
        data[3 + data_length * i] *= 4 * M_PI;
    }
    
    // Put data table into individual arrays
    mu_.resize(0);
    eta_.resize(0);
    xi_.resize(0);
    switch(dimension_)
    {
    case 2:
        for (int i = 0; i < number_of_ordinates_per_octant; ++i)
        {
            for (int mu_mult = -1; mu_mult < 2; mu_mult += 2)
            {
                for (int eta_mult = -1; eta_mult < 2; eta_mult += 2)
                {
                    int xi_mult = 1;
                    
                    mu_.push_back(data[0 + data_length * i] * mu_mult);
                    eta_.push_back(data[1 + data_length * i] * eta_mult);
                    xi_.push_back(data[2 + data_length * i] * xi_mult);
                    weights_.push_back(data[3 + data_length * i]);
                }
            }
        }
        break;
    case 3:
        for (int i = 0; i < number_of_ordinates_per_octant; ++i)
        {
            for (int mu_mult = -1; mu_mult < 2; mu_mult += 2)
            {
                for (int eta_mult = -1; eta_mult < 2; eta_mult += 2)
                {
                    for (int xi_mult = -1; xi_mult < 2; xi_mult += 2)
                    {
                        mu_.push_back(data[0 + data_length * i] * mu_mult);
                        eta_.push_back(data[1 + data_length * i] * eta_mult);
                        xi_.push_back(data[2 + data_length * i] * xi_mult);
                        weights_.push_back(data[3 + data_length * i]);
                    }
                }
            }
        }
    }
    
    // Get full array of ordinates
    switch(dimension_)
    {
    case 2:
        for (int i = 0; i < number_of_ordinates_; ++i)
        {
            ordinates_.push_back(mu_[i]);
            ordinates_.push_back(eta_[i]);
        }
        break;
    case 3:
        for (int i = 0; i < number_of_ordinates_; ++i)
        {
            ordinates_.push_back(mu_[i]);
            ordinates_.push_back(eta_[i]);
            ordinates_.push_back(xi_[i]);
        }
        break;
    }
}

void LDFE_Quadrature::
check_class_invariants() const
{
    Assert(mu_.size() == number_of_ordinates_);
    Assert(eta_.size() == number_of_ordinates_);
    Assert(xi_.size() == number_of_ordinates_);
    Assert(weights_.size() == number_of_ordinates_);
    Assert(ordinates_.size() == number_of_ordinates_ * dimension_);
    Assert(directions_.size() == number_of_ordinates_);
}

void LDFE_Quadrature::
output(XML_Node output_node) const
{
    output_node.set_attribute("ldfe_quadrature", "quadrature_type");
    output_node.set_child_value(dimension_, "dimension");
    output_node.set_child_value(rule_, "rule");
    output_node.set_child_value(number_of_moments_, "number_of_moments");
    output_node.set_child_value(number_of_ordinates_, "number_of_ordinates");
    output_node.set_child_vector(ordinates_, "ordinates", "dimension-ordinate");
    output_node.set_child_vector(weights_, "weights", "ordinate");
    output_node.set_child_vector(mu_, "mu", "ordinate");
    output_node.set_child_vector(eta_, "eta", "ordinate");
    output_node.set_child_vector(xi_, "xi", "ordinate");
}

int LDFE_Quadrature::
reflect_ordinate(int o,
                 vector<double> const &normal) const
{
    switch(dimension_)
    {
    case 2:
        if (std::abs(std::abs(normal[0]) - 1) < reflection_tolerance_)
        {
            if (mu_[o] > 0)
            {
                return o - 2;
            }
            else
            {
                return o + 2;
            }
        }
        else if (std::abs(std::abs(normal[1]) - 1) < reflection_tolerance_)
        {
            if (eta_[o] > 0)
            {
                return o - 1;
            }
            else
            {
                return o + 1;
            }
        }
        else 
        {
            AssertMsg(false, "surface must be in x, y, or z plane: {" + to_string(normal[0]) + ", " + to_string(normal[1]) + "}");
            
            return o;
        }
    case 3:
        if (std::abs(std::abs(normal[0]) - 1) < reflection_tolerance_)
        {
            if (mu_[o] > 0)
            {
                return o - 4;
            }
            else
            {
                return o + 4;
            }
        }
        else if (std::abs(std::abs(normal[1]) - 1) < reflection_tolerance_)
        {
            if (eta_[o] > 0)
            {
                return o - 2;
            }
            else
            {
                return o + 2;
            }
        }
        else if (std::abs(std::abs(normal[2]) - 1) < reflection_tolerance_)
        {
            if (xi_[o] > 0)
            {
                return o - 1;
            }
            else
            {
                return o + 1;
            }
        }
        else 
        {
            AssertMsg(false, "surface must be in x, y, or z plane: {" + to_string(normal[0]) + ", " + to_string(normal[1]) + ", " + to_string(normal[2]) + "}");
            
            return o;
        }
    default:
        AssertMsg(false, "dimension not found");

        return o;
    }
}

